# -*- coding: utf8 -*-
import base64

from paddlehub.module.module import moduleinfo, serving
import numpy as np
import paddlehub as hub
import os


@moduleinfo(
    name="image_module",
    version="1.0.0",
    summary="ImageClassificationwhich was fine-tuned on the DogCat dataset.",
    author="suntao",
    author_email="",
    type="ImageClassification/mobilenet_v2_imagenet")
class ImageCollages(hub.Module):

    def _initialize(self):
        module = hub.Module(name="mobilenet_v2_imagenet")
        self.dataset = hub.dataset.DogCat()
        data_reader = hub.reader.ImageClassificationReader(
            image_width=module.get_expected_image_width(),
            image_height=module.get_expected_image_height(),
            images_mean=module.get_pretrained_images_mean(),
            images_std=module.get_pretrained_images_std(),
            dataset=self.dataset)

        config = hub.RunConfig(
            use_cuda=True,
            num_epoch=1,
            checkpoint_dir="image_demo",
            batch_size=64,
            eval_interval=50,
            strategy=hub.finetune.strategy.DefaultFinetuneStrategy())

        input_dict, output_dict, program = module.context(trainable=True)

        img = input_dict["image"]

        feature_map = output_dict["feature_map"]

        feed_list = [img.name]

        self.task = hub.ImageClassifierTask(
            data_reader=data_reader,
            feed_list=feed_list,
            feature=feature_map,
            num_classes=self.dataset.num_labels,
            config=config)

        self.task.finetune_and_eval()

    @serving
    def predict(self, data):
        label_map = self.dataset.label_dict()
        index = 0
        # get classification result

        img_data = base64.b64decode(data)
        # 注意：如果是"data:image/jpg:base64,"，那你保存的就要以png格式，如果是"data:image/png:base64,"那你保存的时候就以jpg格式。
        with open('002x.png', 'wb') as f1:
            f1.write(img_data)
        test_data = ["002x.png"]
        run_states = self.task.predict(data=test_data)
        results = [run_state.run_results for run_state in run_states]
        prediction = []
        for batch_result in results:
            # get predict index
            batch_result = np.argmax(batch_result, axis=2)[0]
            for result in batch_result:
                index += 1
                result = label_map[result]
                pStr = ("input %i is %s, and the predict result is %s" %
                        (index, test_data[index - 1], result))
                prediction.append(pStr)

        return prediction


if __name__ == "__main__":
    ernie_tiny = ImageCollages()
    data = ''
    predictions = ernie_tiny.predict(data=data)
    print(predictions)
